	"ui5/mszyba/i18n/i18n.properties":'# App Descriptor\r\nappTitle=ANEMBOK Micha\\u0142 Szyba\r\nappDescription=\r\n\r\nlinkGithubDesc=Source Code on GitHub\r\nlinkGithub=https://github.com/mszyba/sapui5-js-dist\r\n\r\n\r\n\r\n\r\n# Company Data\r\nfirstName=Micha\\u0142\r\nlastName=Szyba\r\njobPosition=ABAP Developer\r\nemail=anembok@anembok.eu\r\nwwwAddress=https://www.dev.anembok.eu\r\nwwwName=dev.anembok.eu\r\nwwwLinkedIn=https://linkedin.com/in/michal-szyba\r\nwwwLinkedInName=LinkedIn.com/in/michal-szyba\r\ncity=Wroc\\u0142aw, Poland\r\n\r\n# Sections titles\r\ntitleSummary=Summary\r\ntitleJobExperience=Job Experience\r\ntitleCertification=Certifications\r\n\r\n\r\n# Descriptions\r\ndescSummary=A SAP technical developer with 3 years of experience in ABAP development and 10 years of experience as a warehouse manager. Proficient in SAP technologies, including Function Modules, Object-Oriented ABAP Programming, Smartforms, SAPScript, ALV, and BADI/Enhancements. Experienced in both maintenance projects, handling user-reported issues, and development projects for clients. Able to work independently and as part of a team, with strong decision-making skills to plan and execute tasks effectively. Quick learner with a problem-solving mindset, eager to take on new challenges and continuously improve technical skills.\r\n\r\n# Table\r\ntableColDate=Date\r\ntableColUpdate=Updated\r\ntableColTitle=Title\r\n\r\n# Certifications\r\ncertDate04=Mar, 2024\r\ncertDate03=Mar, 2024\r\ncertDate02=May, 2023\r\ncertDate01=Nov, 2022\r\n\r\ncertUpDate04=Mar, 2025\r\ncertUpDate03=\r\ncertUpDate02=\r\ncertUpDate01=\r\n\r\ncertDesc04=SAP Certified Associate - Back-End Developer ABAP Cloud (C_ABAPD_2309)\r\ncertDesc03=SAP Certified Development Specialist - ABAP for SAP HANA 2.0 (E_HANAAW_18)\r\ncertDesc02=SAP Certified Development Associate - ABAP with SAP NetWeaver 7.50 (C_TAW12_750)\r\ncertDesc01=ISTQB\\u00ae Certified Tester Foundation Level\r\n\r\ncertLink04=https://www.credly.com/badges/242913f5-2488-49e1-b85e-9e335ccbc5b5\r\ncertLink03=https://www.credly.com/badges/90ec2974-729d-4981-aa59-4ff2ef5ac667\r\ncertLink02=https://www.credly.com/badges/687e4200-e7cd-4fa1-8f6a-adfdf39e2fb4/public_url\r\ncertLink01=http://scr.istqb.org/?name=Szyba&number=19075%2FCTFL%2F2022&orderBy=relevancy&orderDirection=&dateStart=&dateEnd=&expiryStart=&expiryEnd=&certificationBody=&examProvider=&certificationLevel=&country=\r\n\r\n# Job experience\r\njobDate04=Apr, 2024 - present\r\njobDate03=Apr, 2022 - Apr, 2024\r\njobDate02=Sep, 2019 - Mar, 2022\r\njobDate01=Sep, 2011 - Mar, 2022\r\n\r\njobTit04=ABAP Developer\r\njobTit03=Junior ABAP Developer\r\njobTit02=SAP Key User on Warehouse\r\njobTit01=Warehouse Team Lead\r\n\r\n\r\n\r\n\r\n',
